-- Creating a data base
CREATE DATABASE RETAIL_DB;

-- Dropping a database
-- DROP DATABASE RETAIL_DB;

-- USE THE DATABASE
USE RETAIL_DB;

-- CREATING SALES FACT
CREATE TABLE SALES_FACT
(
	ORDER_ID INT PRIMARY KEY,
    CUSTOMER_ID INT NOT NULL,
    ORDER_DATE DATE,
    STORE_ID SMALLINT
);

-- DROP TABLE SALES_FACT;

-- DIFFERENT APPROACH ON PRIMARY KEY
CREATE TABLE SALES_FACT
(
	ORDER_ID INT,
    CUSTOMER_ID INT NOT NULL,
    ORDER_DATE DATE,
    STORE_ID SMALLINT,
    PRIMARY KEY (ORDER_ID)
);

-- CREATING ORDER_PRODUCT_MAPPING TABLE
CREATE TABLE ORDER_PRODUCT_MAPPING
(
 ORDER_ID INT,
 PRODUCT_ID VARCHAR(10),
 QUANTITY_ORDERED INT
);

ALTER TABLE ORDER_PRODUCT_MAPPING
ADD PRIMARY KEY (ORDER_ID, PRODUCT_ID);

-- ADDING FOREIGN KEY CONSTRAINT

ALTER TABLE SALES_FACT
ADD CONSTRAINT ORDER_ID_fn
	FOREIGN KEY (ORDER_ID) REFERENCES ORDER_PRODUCT_MAPPING(ORDER_ID);


-- Loading data into sales_fact

SELECT COUNT(*) FROM SALES_FACT;

